import React from 'react'
import styles from './../../styles/MintPage.module.css'

const Mint = () => {
	return (
		<main className={styles.container}>
			<div className={styles.container__mint}>
				<h1>Hello</h1>
			</div>
		</main>
	)
}

export default Mint
